import KategoriSayfasi from '../../components/kategori/KategoriSayfasi';

const HobiOyunlari = () => {
  return (
    <KategoriSayfasi
      kategoriAdi="Hobi Oyunları"
      aciklama="Eğlenceli ve eğitici hobi oyunları, zeka oyunları ve aktivite setleri."
    />
  );
};

export default HobiOyunlari;
